import React, { useState } from "react";
import "./Header.css";
import { Link } from "react-router-dom";
import Button from "@mui/material/Button";
import ArrowDropDownOutlinedIcon from '@mui/icons-material/ArrowDropDownOutlined';
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';
import FavoriteBorderOutlinedIcon from '@mui/icons-material/FavoriteBorderOutlined';
import ShoppingBagOutlinedIcon from '@mui/icons-material/ShoppingBagOutlined';

const Header = () => {
    const [showDropdown, setShowDropdown] = useState(false);

    const toggleDropdown = () => setShowDropdown(!showDropdown);

    return (
        <section className="header">
            <a href="#" className="logo">
                2T Store<span>.</span>
            </a>
            <nav className="navbar">
                <Button><Link to="/">Home</Link></Button>
                <div 
                className="dropdown"
                onMouseEnter={toggleDropdown}
                onMouseLeave={toggleDropdown}
                >
                <Button><Link to="/listing">Shop</Link><ArrowDropDownOutlinedIcon/></Button>
                {showDropdown && (
                        <div className="dropdown-content">
                            <Button><Link to="/about">New Products</Link></Button>
                            <Button><Link to="/team">Feature Products</Link></Button>
                            <Button><Link to="/services">Best Sellers</Link></Button>
                        </div>
                    )}
                </div>
                {/* Dropdown */}
                <Button><Link>Giới Thiệu</Link></Button>
                <Button><Link>Liên Hệ</Link></Button>
                <Button><Link to="/Blog">Blog</Link></Button>
                <div className="dropdown"
                onMouseEnter={toggleDropdown}
                onMouseLeave={toggleDropdown}>
                <Button><Link>Sports</Link><ArrowDropDownOutlinedIcon/></Button>
                {showDropdown && (
                        <div className="dropdown-content">
                            <Button><Link to="/about">Running</Link></Button>
                            <Button><Link to="/team">Football</Link></Button>
                            <Button><Link to="/services">Basketball</Link></Button>
                            <Button><Link to="/services">Training and gym</Link></Button>
                            <Button><Link to="/services">Tennis</Link></Button>
                            <Button><Link to="/services">Yoga</Link></Button>
                            <Button><Link to="/services">SkateBoarding</Link></Button>
                        </div>
                    )}
                </div>
            </nav>
            <div className="icons">
                <div className="search-box">
                    <SearchOutlinedIcon />
                    <input type="text" placeholder="Search" />
                </div>
                <SearchOutlinedIcon className="icon" />
                <div className="cart">
                    <ShoppingBagOutlinedIcon className="icon" />
                    <span className="cart-count">1</span>
                </div>
            </div>
        </section>
    );
};

export default Header;
